import React, { useState, createContext } from "react";

export const PlacesContext = createContext();

export const PetPlacesProvider = (props) => {
  const [places, setPlaces] = useState([
    {
      id: 1,
      name: "Airi Satou",
      position: "Accountant",
      office: "Tokyo",
      age: "33",
      startdate: "2008/11/28",
      salary: "$162,700",
    },

    {
      id: 2,
      name: "Angelica Ramos",
      position: "Chief Executive Officer (CEO)",
      office: "London",
      age: "47",
      startdate: "2009/10/09",
      salary: "$1,200,000",
    },
  ]);
  const [addNew, setAddNew] = useState(false);

  const [columns, setColumns] = useState([
    {
      title: "Title",
    },
    {
      title: "Address",
    },
    {
      title: "Longitude",
    },
    {
      title: "Latitude",
    },
    {
      title: "Open Time",
    },
    {
      title: "Close Time",
    },
    {
      title: "Postal Code",
    },
    {
      title: "Category",
    },
    {
      title: "Phone",
    },
    {
      title: "Facebook Link",
    },
    {
      title: "Instagram Link",
    },
    {
      title: "Twitter Link",
    },
    {
      title: "Email",
    },
    {
      title: "URL",
    },
    {
      title: "Action",
    },
  ]);

  return (
    <PlacesContext.Provider
      value={{
        places: [places, setPlaces],
        addNew: [addNew, setAddNew],
        columns: [columns, setColumns],
      }}
    >
      {props.children}
    </PlacesContext.Provider>
  );
};
